import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <footer>This is a footer </footer>
      <p className="App-logo"> FUN! </p>
      <p>
        <ul>
          <li>Apples</li>
          <li>Oranges</li>
          <li>Strawberries</li>
        </ul>
      </p>
    </div>
  );
}

export default App;
